import React from "react";
import logo3 from "../images/zaderea.png";
import starIcon from "../images/rating-icon.jpeg";

export default function Card(){

    return(

        <div className="card">
            <img src={logo3} alt="logo3" className="card--img1" />
            span<img src={starIcon} alt="star-icon" className="card--star" />
            <span>Rating</span>
            <span>Review count</span>
            <p>From <b>$136</b>/person</p>

        </div>
    )
}
